import React from "react";
import { Paper, Grid, Box } from "@material-ui/core";
import billboardPic from "../images/k.jpg";
import { matchPc, matchTablet } from "../DetectDevice";
function Profile() {
  return (
    <Paper>
      <Grid container style={{ height: "100vh" }}>
        <Grid
          item
          component={Box}
          display={{ xs: "none", md: "block" }}
          md={2}
        ></Grid>
        <Grid item xs={12} md={8}>
          <Grid
            item
            xs={12}
            style={{
              position: "absolute",
              width: matchPc ? "66.5vw" : "98vw",
              fontSize: "50px",
              zIndex: 31,
              height: "auto",
              top: matchPc ? "0.2em" : "0.35em",
              textAlign: "right",
              /// backgroundColor: "#00ccff",
              //center
            }}
          >
            James Bond
          </Grid>
          <img
            className="turlight"
            style={{
              zIndex: 3,
              objectFit: "contain",
              width: "100%",
              borderRadius: "0px",
              borderBottomLeftRadius: "7px",
              borderBottomRightRadius: "7px",
              margin: "auto",
            }}
            src={billboardPic}
            alt="Superstarz Billboard Image"
          />
        </Grid>
      </Grid>
    </Paper>
  );
}

export default Profile;
